import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import vuetify from "@/plugins/vuetify"
import Vue from "vue"
// styles
import "@/assets/scss/main.scss"

// Import Vuetify components that you want to use globally
import { VDataTable } from 'vuetify/lib/components';

// Register Vuetify components globally
Vue.component('v-data-table', VDataTable);

// Create the Vue app and set the isCustomElement option to suppress the warning
createApp(App, {
  compilerOptions: {
    isCustomElement: tag => tag.startsWith('v-') // Exclude elements starting with 'v-' from component resolution
  }
}).use(store).use(vuetify).use(router).mount('#app')
